    fun ECH_GET_CHANNEL_LIST_NOT() = OutPacket(NET_OK).apply {
        // KChannelInfo
        encodeInt(server.channels.size)
        for (i in 1..server.channels.size) {
            encodeInt(i) // m_iChannelID
            encodeInt(i * 3) // m_iServerUID
            encodeInt(i) // m_iChannelID
            encodeString(server.getChannelById(i).nName) // m_wstrChannelName
            encodeInt(0) // m_iServerGroupID
            encodeString("127.0.0.1") // m_wstrIP
            encodeShort(server.getChannelById(i).nPort/*9300*/) // m_usMasterPort
            encodeShort(server.getChannelById(i).nSubPort/*9301*/) // m_usNCUDPPort
            encodeInt(900) // m_iMaxUser 最大人數
            encodeInt(0) // m_iCurrentUser 目前人數
            encodeInt(0) // m_iCurPartyCount 組隊隊伍數
            encodeInt(0) // m_iPlayGamePartyCount // 正在副本的隊伍數
            encodeBoolean(true)
            encodeBoolean(true)
            encodeString("")
        }
        // KChannelBonusInfo
        encodeInt(server.channels.size)
        for (i in 1..server.channels.size) {
            encodeInt(i) // m_iChannelID
            encodeBoolean(true) // m_bEnable
            encodeInt(server.getChannelById(i).BeginLv)
            encodeInt(server.getChannelById(i).EndLv)
            encodeInt(server.getChannelById(i).PerExp)
            encodeInt(server.getChannelById(i).PerED)
        }
        end(ECH_GET_CHANNEL_LIST_NOT)
    }

